import axios from 'axios'

const Hero = () => {

    const [hero,setHero]= useState({})

    useEffect(()=> {
        axios.get("https://cdn.jsdelivr.net/gh/akabab/superhero-api@0.3.0/api/id/1.json")
        .then(res=>{
            console.log(res.data)
            setHero(res.data)
        }).catch(err=>{
            console.log(err)
        })

    }, [])
    return ( 
        <fieldset>
            <legend>
                Hero.jsx 
            </legend> 
            {JSON.stringify(hero)}
            <div>
                <h2>{hero.name}</h2>
            </div>
            <h2>Loading ...</h2>
        </fieldset>
    )
}

export default Hero
